import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import axios from 'axios';
import './AdminDashboard.css'; // Import the CSS file

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [filteredUsers, setFilteredUsers] = useState([]);
  const [showPaidOnly, setShowPaidOnly] = useState(false);
  const [payments, setPayments] = useState([]);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const authToken = sessionStorage.getItem('authToken');
    const userRole = sessionStorage.getItem('userRole');

    if (!authToken || userRole !== 'admin') {
      navigate('/auth');
    } else if (location.state === null && location.pathname === '/admin-dashboard') {
      navigate('/auth');
    } else {
      fetchUsers(authToken);
      fetchPayments(authToken);
    }
  }, [navigate, location]);

  const fetchUsers = async () => {
    try {
      const token = sessionStorage.getItem('authToken');
      const response = await axios.get('http://localhost:5001/api/users/admin-data', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setUsers(response.data.users);
    } catch (error) {
      console.error('Error fetching users:', error);
    }
  };

  const fetchPayments = async (token) => {
    try {
      const response = await axios.get('http://localhost:5001/api/admin/payments', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setPayments(response.data.payments);
    } catch (error) {
      console.error('Error fetching payments', error);
    }
  };

  const handleFilterChange = () => {
    setShowPaidOnly(!showPaidOnly);
    if (!showPaidOnly) {
      const paidPhotographers = users.filter(user => user.isPaid && user.role === 'photographer');
      setFilteredUsers(paidPhotographers);
    } else {
      setFilteredUsers(users);
    }
  };

  const handleLogout = () => {
    sessionStorage.removeItem('authToken');
    sessionStorage.removeItem('userRole');
    navigate('/auth');
  };

  return (
    <div className="dashboard-container">
      <aside className="sidebar">
        <div className="logo">PICRECO</div>
        <nav>
          <ul>
            <li>Dashboard</li>
            <li>Users</li>
            <li>Accounts</li>
            <li>Statistics</li>
          </ul>
        </nav>
        <div className="teams">
          <h4>Teams</h4>
          <ul>
            <li>Marketing</li>
            <li>Development</li>
          </ul>
        </div>
        <div className="settings">
          <button>Settings</button>
          <button onClick={handleLogout}>Log Out</button>
        </div>
      </aside>

      <main className="main-dashboard">
        <header className="dashboard-header">
          <h1>Analytics</h1>
        </header>

        <section className="dashboard-stats">
          <div className="stat-card">
            <h2>Totall sers</h2>
            <p>Data about team payments...</p>
          </div>
          <div className="stat-card">
            <h2>Totall payment</h2>
            <p>$5,839</p>
          </div>
          <div className="stat-card">
            <h2>Income Statistics</h2>
            <p>Income stats here...</p>
          </div>
          <div className="stat-card">
            <h2>Best Plan</h2>
            <p>$16.58 Per Month</p>
          </div>
        </section>

        <section className="payment-tracking">
          <h2>Recently Payments</h2>
          <ul>
            {payments.map(payment => (
              <li key={payment._id}>
                {payment.userEmail} - {payment.planName}: ${payment.planPrice} ({payment.status})
              </li>
            ))}
          </ul>

          <h2>Transactions</h2>
          <ul>
            {filteredUsers.map(user => (
              <li key={user._id}>
                {user.name} ({user.email}) - {user.role}
              </li>
            ))}
          </ul>
        </section>
      </main>
    </div>
  );
};

export default AdminDashboard;
